package oracle.sysman.emaas.platform.dashboards.ws.rest;

import java.io.ByteArrayInputStream;

import javax.ws.rs.GET;
import javax.ws.rs.Path;
import javax.ws.rs.PathParam;
import javax.ws.rs.Produces;
import javax.ws.rs.core.MediaType;
import javax.ws.rs.core.Response;

import sun.misc.BASE64Decoder;

@Path("/demo")
public class DemoDashboardsServer
{
	public DemoDashboardsServer()
	{
		super();
	}

	@GET
	@Path("image/{id}")
	@Produces(MediaType.TEXT_PLAIN)
	public Response getDashbaorsdImage(@PathParam("id") String id) throws Exception
	{
		String data = "data:image/png;base64,";
		return Response.ok(data).header("Content-type", MediaType.TEXT_PLAIN).header("Access-Control-Allow-Origin", "*")
				.header("Access-Control-Allow-Methods", "POST, GET, PUT, UPDATE, OPTIONS")
				.header("Access-Control-Allow-Headers", "Content-Type, Accept, X-Requested-With").build();
	}

	@GET
	@Path("imagestream/{id}")
	@Produces("image/png")
	public Response getDashbaorsdImageStream(@PathParam("id") String id) throws Exception
	{
		String data = "data:image/png;base64,";
		String imageDataBytes = data.substring(data.indexOf(",") + 1);

		ByteArrayInputStream stream = new ByteArrayInputStream(new BASE64Decoder().decodeBuffer(imageDataBytes));
		return Response.ok(stream).header("Content-type", "image/png").header("Access-Control-Allow-Origin", "*")
				.header("Access-Control-Allow-Methods", "POST, GET, PUT, UPDATE, OPTIONS")
				.header("Access-Control-Allow-Headers", "Content-Type, Accept, X-Requested-With").build();
	}
}
